quarkus.elasticloadbalancing.endpoint-override=http://localhost:9090

quarkus.elasticloadbalancing.aws.region=us-east-1
quarkus.elasticloadbalancing.aws.credentials.type=static
quarkus.elasticloadbalancing.aws.credentials.static-provider.access-key-id=test-key
quarkus.elasticloadbalancing.aws.credentials.static-provider.secret-access-key=test-secret

quarkus.elasticloadbalancing.sync-client.type = url
quarkus.elasticloadbalancing.sync-client.connection-timeout = 0.100S
quarkus.elasticloadbalancing.sync-client.socket-timeout = 0.100S